import React from "react";
import modelMan from "../media/sapiens(1).png";

function Hero() {
  return (
    <div className="flex border-2 border-red-500 mx-auto max-w-3xl">
      <ul className="grid grid-cols-1 gap-8 md:grid-cols-2 px-2 md:gap-8">
        {/* Practical */}
        <li className="md:text-center items-center rounded-lg md:h-full h-full mb-6 px-3">
          <img src={modelMan} alt="Man" />
        </li>
        {/* Reliable */}
        <li className="md:text-center items-center rounded-lg md:h-full h-full mb-6 px-10">
          <div className="pt-9 text-2xl  md:text-lg font-bold  mb-2">
            Reliable
          </div>
        </li>
      </ul>
    </div>
  );
}

export default Hero;
